import React from 'react';
// import MenuBar from "./menuBar";
import * as style from "../css/light/phoneListContainer"
import SearchList from "./searchList/searchList"

export default function Main() {

  return (
    <div>
      <div style={style.searchListContainer}>
        <SearchList/>
        <div style={{position: "absolute", left: "62.3vw", margin: "3px 0px 0px 3px", width: "50px", height: "24px"}}>
          <div style={{pointer: "cursor", float: "left", margin: "2px 0px 0px 2px", width: "22px", height: "20px", backgroundColor: "green"}}></div>
          <div style={{pointer: "cursor", float: "right", margin: "2px 2px 0px 0px", width: "22px", height: "20px", backgroundColor: "green"}}></div>
        </div>
      </div>
    </div>
  )
}
